  let open = openSym[type];
  let close = closeSym[type];
  let count = 1;
  let k;

  for (k = i + 1; k < str.length; k++) {
    if (open === '"' || open === "'") {
      if (str[k] === close) count--;
      if (str[k] === '\\') k++;
    } else {
      if (str[k] === open) count++;
      if (str[k] === close) count--;
    }

    if (count === 0) break;
  }

  if (count !== 0) return null;
  let obj = str.slice(i, k + 1);
